import React from "react";
import {
  LinkConteoner,
  InfoLink,
  Surname,
  Name,
  Position,
  PersonConteiner,
} from "./style";
import Data from "Entites/Data";
import phoneMask from "Features/phoneMask";
import { Icon } from "Shared/svg/Icon";

export default function AboutPerson() {
  const {
    main_number,
    first_number,
    second_number,
    mail,
    site,
    address,
    addressСoordinates,
    date,
    rank,
    name,
    surname,
    patronymic,
    position,
  } = Data.person;

  return (
    <PersonConteiner>
      <Surname> {surname} </Surname>
      <Name>
        {name} {patronymic}
      </Name>
      <Position>{position}</Position>
      <LinkConteoner>
        <InfoLink href={`tel:+${main_number}`}>
          <Icon id="mobile" className="info-contacts" />
          {phoneMask(main_number)}
        </InfoLink>
        <InfoLink href={`tel:+${first_number}`}>
          <Icon id="phone" className="info-contacts" />
          {phoneMask(first_number)}
        </InfoLink>
        <InfoLink href={`tel:+${second_number}`}>
          <Icon id="phone" className="info-contacts" />
          {phoneMask(second_number)}
        </InfoLink>
        <InfoLink>
          <Icon id="mail" className="info-contacts" />
          {mail}
        </InfoLink>
        <InfoLink href="https://ryan-gosling.ru/biografiya/" target="_blank">
          <Icon id="site" className="info-contacts" />
          {site}
        </InfoLink>
        <InfoLink>
          <Icon id="address" className="info-contacts" />
          {address}
        </InfoLink>
        <InfoLink>
          <Icon id="date" className="info-contacts" />
          {date}
        </InfoLink>
        <InfoLink>
          <Icon id="user" className="info-contacts" />
          {rank}
        </InfoLink>
      </LinkConteoner>
    </PersonConteiner>
  );
}
